import axios from "axios";
import { useState, useEffect } from "react";
import toast from "react-hot-toast";
import { Link } from "react-router-dom";

function AdminDashboardComplete() {
  const [allData, setAllData] = useState({
    users: [],
    managers: [],
    restaurants: []
  });
  const [loading, setLoading] = useState(false);

  // Dummy Admin Profile (replace this with real API call or localStorage data)
  const adminProfile = {
    name: "Admin John Doe",
    email: "admin@example.com",
    role: "Admin"
  };

  const fetchAllData = async () => {
    setLoading(true);
    try {
      const [usersRes, managersRes, restaurantsRes] = await Promise.all([
        axios.get("http://localhost:4000/api/auth/getallusers"),
        axios.get("http://localhost:4000/api/auth/getmanagers"),
        axios.get("http://localhost:4000/api/auth/getrestaurants")
      ]);

      if (
        usersRes.data.success &&
        managersRes.data.success &&
        restaurantsRes.data.success
      ) {
        toast.success("All data fetched successfully!");
        setAllData({
          users: usersRes.data.users || [],
          managers: managersRes.data.managers || [],
          restaurants: restaurantsRes.data.restaurants || []
        });
      } else {
        toast.error("Some data fetch failed");
      }
    } catch (err) {
      console.error(err);
      toast.error("Error fetching data");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchAllData();
  }, []);

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 via-blue-100 to-blue-200 p-5">
      <div className="max-w-6xl mx-auto">

        {/* Admin Welcome Section */}
        <div className="bg-white p-6 rounded-xl shadow-lg mb-10 flex justify-between items-center">
          <div>
            <h1 className="text-3xl font-bold text-blue-800 mb-2">Welcome, {adminProfile.name}!</h1>
            <p className="text-gray-700 text-lg">Email: {adminProfile.email}</p>
            <p className="text-gray-700 text-lg">Role: {adminProfile.role}</p>
          </div>
          <div>
            <Link to="/">
              <button className="bg-blue-500 px-6 py-2 rounded-full text-white font-semibold shadow-md hover:scale-105 transition-transform">
                Back to Home
              </button>
            </Link>
          </div>
        </div>

        {/* Summary Cards */}
        <div className="grid grid-cols-1 sm:grid-cols-3 gap-6 mb-10">
          <SummaryCard title="Total Users" count={allData.users.length} color="green" />
          <SummaryCard title="Total Managers" count={allData.managers.length} color="purple" />
          <SummaryCard title="Total Restaurants" count={allData.restaurants.length} color="orange" />
        </div>

        {/* Users List */}
        <DataTable title="All Users" headers={["Username", "Email", "Role"]} data={allData.users.map(u => [u.username, u.email, u.role])} />

        {/* Restaurants List */}
        <Section title="All Restaurants">
          {allData.restaurants.length > 0 ? (
            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-5">
              {allData.restaurants.map((res) => (
                <div key={res._id} className="bg-white p-4 rounded-lg shadow border">
                  <p><strong>Name:</strong> {res.name}</p>
                  <p><strong>Address:</strong> {res.address}</p>
                  <p><strong>Special For:</strong> {res.specialfor}</p>
                </div>
              ))}
            </div>
          ) : (
            <p>No restaurants found.</p>
          )}
        </Section>

        {/* Managers List */}
        <Section title="All Managers">
          {allData.managers.length > 0 ? (
            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-5">
              {allData.managers.map((man) => (
                <div key={man._id} className="bg-white p-4 rounded-lg shadow border">
                  <p><strong>Name:</strong> {man.Name}</p>
                  <p><strong>Aadhaar:</strong> {man.AdharNumber}</p>
                  <p><strong>Phone:</strong> {man.PhoneNumber}</p>
                  <p><strong>PAN:</strong> {man.PanNumber}</p>
                </div>
              ))}
            </div>
          ) : (
            <p>No managers found.</p>
          )}
        </Section>

      </div>
    </div>
  );
}

// Small reusable components

function SummaryCard({ title, count, color }) {
  const colorMap = {
    green: "text-green-600",
    purple: "text-purple-600",
    orange: "text-orange-600"
  };

  return (
    <div className="bg-white p-6 rounded-lg shadow-md border">
      <h2 className="text-xl font-semibold text-blue-700 mb-3">{title}</h2>
      <p className={`text-4xl font-bold text-center ${colorMap[color]}`}>{count}</p>
    </div>
  );
}

function DataTable({ title, headers, data }) {
  return (
    <div className="bg-white/90 p-6 rounded-lg shadow-md mb-10">
      <h2 className="text-2xl font-semibold text-blue-700 mb-5">{title}</h2>
      {data.length > 0 ? (
        <div className="overflow-x-auto">
          <table className="min-w-full text-left border-collapse">
            <thead>
              <tr>
                {headers.map((h, i) => (
                  <th key={i} className="border p-3">{h}</th>
                ))}
              </tr>
            </thead>
            <tbody>
              {data.map((row, i) => (
                <tr key={i}>
                  {row.map((cell, j) => (
                    <td key={j} className="border p-3">{cell}</td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ) : (
        <p>No data found.</p>
      )}
    </div>
  );
}

function Section({ title, children }) {
  return (
    <div className="bg-white/90 p-6 rounded-lg shadow-md mb-10">
      <h2 className="text-2xl font-semibold text-blue-700 mb-5">{title}</h2>
      {children}
    </div>
  );
}

export default AdminDashboardComplete;
